import Card from "./card"

export default function Admin() {

    const [allUsers, set] = useState([])

    console.log(allUsers)

    useEffect(() => {
        fetch('http://localhost:8000/admin').then(data => data.json()).then(data => console.log(data))
    }, [])



    return (
        <div style={{width:'95%',margin:'2rem auto'}}>
        <div style={{display:'flex',flexDirection:'column'}}>
            {

                allUsers.allUsers.length && allUsers.map((user) => (
                  <Card key={user} elem={user}/>
                ))

            }
        </div>
        </div>
    )
}
